import React from 'react';

class Header extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            isOpen: false
        }
    }
    render() {

        return (
            <div className="header">
                <div className="nav-bar">
                    <div className="burger-menu">
                        <div className="line"></div>
                        <div className="line"></div>
                        <div className="line"></div>
                    </div>
                </div>
                <div className="menu-content">

                </div>
            </div>
        )
    }
}

export default Header;
